import styled from 'styled-components';

export const StyledCreateNewTeam = styled.div`
  text-align: center;
  display: flex;
  flex-direction: column;
  margin: 1em 0;

  & div {
    margin: 0.5em 0;
  }

  & .MuiFormGroup-root {
    display: flex;
    flex-direction: column;
    padding: 1em 2em;
  }

  & button {
    margin: 0.5em 0;
  }
`;
